import React from 'react';
import './note_signup.css'



class NoteSignUp extends React.Component{
  render(){
    return(
      <div className="note">
        <h5>Not registered yet?</h5>
        <a href="#"><span>Register here</span></a>
      </div>
    )
  }
}
export default NoteSignUp
